import React from 'react';

function HostRegister() {
    return (
        <div class="container align-middle">
            <main role="main" class="pb-3">
                <div class="text-center">
                    <h1 class="display-4">Create Host Account</h1>
                </div>
            </main>
        </div>
    );
}

export default HostRegister;
